 import "./Login.css";
import React, { useState } from "react";

function Login() {




  return(


<div className="loginPage">
<div className="organize">
<p className="loginString">log in</p>
</div>
<div className="inputLogin">
<input type="email" className="firstInput" placeholder="enterYourEmail"  />
<input type="password"className="secondInput" placeholder="enterYourPassword" />
</div>

<div className="enterToLogIin">

<h1 className="enterToLogIinString">Log in</h1>
<a  className="signInString" onClick={()=>{onClickf}} >sign in</a>


</div>

</div>



)
}

export default Login;
